$(document).ready(function() {
    new LazyLoad({
        elements_selector: "img.lazy, video.lazy, div.lazy, section.lazy, header.lazy"
    })
}), $(document).ready(function() {
    var e;
    $("[href*='tel:']").click(function(e) {
        gtag("event", "click", {
            name: "Call",
            event_category: "CTA",
            event_label: "Call"
        })
    }), $("[href*='mailto:']").click(function(e) {
        gtag("event", "click", {
            name: "Email",
            event_category: "CTA",
            event_label: "Email"
        })
    }), $(".video-btn").click(function() {
        e = $(this).data("src")
    }), $("#videoModal").on("shown.bs.modal", function(i) {
        $("#video").attr("src", e + "?autoplay=0&amp;modestbranding=1&amp;showinfo=0")
    }), $(".close-btn, .overlay").on("click", function() {
        $(".sidebar-menu").removeClass("active"), $(".overlay").removeClass("active")
    }), $(".menu-btn").on("click", function() {
        $(".sidebar-menu").addClass("active"), $(".overlay").addClass("active")
    })
}), $("#silk-slider").not(".slick-initialized").slick({
    dots: !1,
    infinite: !1,
    slidesToShow: 3,
    slidesToScroll: 3,
    arrows: !0,
    prevArrow: '<i class="icon-left left-arrow"></i>',
    nextArrow: '<i class="icon-right right-arrow"></i>',
    responsive: [{
        breakpoint: 1024,
        settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            infinite: !1,
            dots: !1,
            arrows: !1
        }
    }, {
        breakpoint: 768,
        settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            infinite: !1,
            dots: !1,
            arrows: !0
        }
    }, {
        breakpoint: 546,
        settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            arrows: !1
        }
    }]
}), $("#blog-slider").not(".slick-initialized").slick({
    dots: !1,
    infinite: !1,
    slidesToShow: 3,
    slidesToScroll: 1,
    arrows: !0,
    prevArrow: '<i class="icon-left left-arrow"></i>',
    nextArrow: '<i class="icon-right right-arrow"></i>',
    responsive: [{
        breakpoint: 576,
        settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            arrows: !1
        }
    }]
}), $("#faq").on("show.bs.collapse", function(e) {
    $(e.target).prev(".card-header").addClass("active")
}), $("#faq").on("hidden.bs.collapse", function(e) {
    $(e.target).prev(".card-header").removeClass("active")
});